import logo from './logo.svg';
import './App.css';

function App() {
  const predictors = [{sex: 'Sex'}, 
                      {age: 'Age'}, 
                      {bmi: 'BMI'}, 
                      {weight: 'Weight'}, 
                      {height: 'Height'}, 
                      {initialo2: 'O2'}, 
                      {initialhr: 'Heart Rate'}, 
                      {initialrr: 'Respiratory Rate'}]
  predictors.map(c => console.log(c))
  return (
    <div className="App">
      {predictors.map(c => {
        <div className='predictor'>
        <label id='label_sex' >{c}</label>
        <input id='sex' for='label_sex' />
        </div>
      })};
    </div>
  );
}

export default App;
